import React, { Component } from 'react'
import RenderAll from './components/RenderAll'
import { BrowserRouter as Router, Link, Route, Switch, useParams} from 'react-router-dom';


class App extends Component {
  constructor(props) {
    super(props)

    this.state = {
       activeTicker: null
    }
  }

  setActiveTicker = (ticker) => {
    this.setState({
      activeTicker: ticker
    })
  }


  render() {
    return (
      <Router >
        <Route exact path ="/" component={RenderAll} 
                activeTicker={this.state.ticker} 
                setActiveTicker = {this.setActiveTicker} />
        <Route exact path="/:tickerID" component={RenderAll}/>
      </Router >        
    )
  }
}


export default App;
